window.bookSummaryJSON = "<p>Jade has spent her life fighting boredom in the terminally ill ward. Surfing the net or reading, she always envied the ability of others to go out and experience the world. She knew her wish to live a normal life was far beyond her reach, but after waking up one morning without the sounds of her life support, she opens her eyes and finds herself with a weak but healthy body in a magical world.&nbsp;</p> <p>As blue gamelike system notifications fill her vision, she knows she'll have to adapt quickly in order to survive, but this is all she ever dreamed of, so Jade is up to the challenge. She will soon realize that you need to be careful what you wish for.&nbsp;</p> <p>This is Andara, where her true adventure finally begins.</p>"; 
